import React from 'react'
import project from '../../components/section/projects/timeline/project'

const AllProjects = () => {
    return (<div>
        {project.map((element, index) => (
            <div key={index}>
                <div className='img'>
                    <img src='./'></img>
                </div>
                <div>
                    <h2>
                        {element.title}
                    </h2>
                    <p>
                        {element.date}
                    </p>
                </div>
            </div>
        ))}
        </div>);
}

export default AllProjects
